#include <bits/stdc++.h>
#define rep(i, n) for(int i = 0; i < n; i++)

using namespace std;

int main() {
    int i, k, n;
    string s;
    cin >> s >> n;
    int cnt = 0, c[27] = {0}, m = s.length();
    rep(i, 26) c[i] = (m + 1) * (i + 1);
    int dp[27][1001] = {0}, dp2[27] = {0}, ans = m;
    for (i = 0; i < m; i++) {
        rep(j, 26) cnt += s[i] - 'a' == j? 1 : 0;
        rep(j, 26) dp[j][i] = dp2[j] + (s[i] - 'a' == j? 0 : 1);
        rep(j, 26) {
            if (j!= i && s[i] == s[j]) {
                for (int x = j + 1; x <= m; x++) {
                    dp[j][x] = dp[j][x - 1];
                }
            }
        }
    }
    rep(i, 26) sort(dp[i], dp[i] + m + 1);
    rep(i, m + 1) rep(j, 26) dp2[j] = dp2[j] + (dp[j][i] > c[j]? dp[j][i] - c[j] : 0);
    if (cnt >= n) { cout << 0; return 0; }
    rep(i, n - cnt) sort(c, c + 26);
    rep(i, 26) rep(j, m + 1) dp2[i] += dp[i][j] > c[i]? dp[i][j] - c[i] : 0;
    rep(i, 26) ans = min(ans, dp2[i]);
    if (ans == m) ans = -1;
    cout << ans;
    return 0;
}

