int main() {
	string s;
	cin >> s;
	int k;
	cin >> k;
	sort(s.begin(), s.end());
	int sz = s.size();
	int last_seen = -1;
	for(int i=0;i<sz;i++){
		if(last_seen == -1){
			last_seen = i;
		}
		else{
			if(s[i] == s[last_seen]){
				last_seen++;
			}
			else{
				break;
			}
		}
	}
	if(last_seen+1 < k){
		cout<<"impossible";
	}
	else{
		cout<<last_seen - k + 1;
	}
	return 0;
}

