  vector<int> in(n), out(n);
  for(int i=0;i<n;i++){
    string s;
    cin>>s;
    int x;
    cin>>x;
    if(s[0]=='+'){
      in[i]=x;
      ma[x]++;
    }
    else{
      out[i]=x;
      ma[x]--;
    }
  }
  vector<int> ans(n+1,-1);
  ans[0]=0;
  for(int i=0;i<n;i++){
    if(ans[i]==-1){
      continue;
    }
    int diff=0;
    if(i==0){
      diff=-ans[i];
    }
    else{
      if(ans[i-1]==-1){
        diff=-ma[out[i-1]];
      }
      else{
        diff=ma[out[i-1]]-ans[i-1];
      }
    }
    ans[i+1]=ans[i]+diff;
  }
  int cnt=0;
  for(int i=0;i<=n;i++){
    if(ans[i]>=cnt){
      cnt++;
    }
  }
  cout<<cnt;
  return 0;
}

