#include<stdio.h>
int gcd(int x,int y){
	while(y){
		x%=y;
		x^=y^=x^=y;
	}
	return x;
}
int main(){
	int n,a,b;
	scanf("%d%d%d",&n,&a,&b);
	if(b*a<n || (n&1&&a&1)){
		printf("-1");
		return 0;
	}
	int d=gcd(a,b);
	int k=(a*b-n)/(d*d);
	for(int i=0;i<b;i++){
		for(int j=0;j<a;j++){
			printf("%d",(j*d/b+k*d)<=n?(j*d/b+k*d):0);
			printf("%c",j==a-1?'\n':' ');
		}
	}
}

