int gcd(int a,int b){
  if(a<0){a*=-1;}
  if(b<0){b*=-1;}
  while(a!=b){
    if(a>b){
      a-=b;
    }
    else{
      b-=a;
    }
  }
  return a;
}
int lcm(int a,int b){
  return (a/gcd(a,b))*b;
}  

