class DSU
{
public:
  DSU()
  {
    for(int i = 1; i <= 26; i++)
    {
      parent[i] = i;
    }
  }

  int find(int v)
  {
    if(v!= parent[v])
    {
      parent[v] = find(parent[v]);
    }

    return parent[v];
  }

  void join(int a, int b)
  {
    int rootA = find(a);
    int rootB = find(b);

    if(rootA!= rootB)
    {
      parent[rootA] = rootB;
    }
  }

private:
  int parent[101];
};

