const int MAX_N = 2000 + 10;

struct State {
  int x, y, dist;
};

int n, m, k;
int x[MAX_N], y[MAX_N];
bool visited[MAX_N][MAX_N];

priority_queue<State, vector<State>, greater<State> > pq;

void bfs(int sx, int sy) {
  pq.push(State{sx, sy, 0});
  visited[sx][sy] = true;

  while(!pq.empty()) {
    State s = pq.top();
    pq.pop();

    if (s.x == 0 && s.y == 0) {
      printf("%d %d\n", s.x, s.y);
      return;
    }

    for (int dx = -1; dx <= 1; dx++)
      for (int dy = -1; dy <= 1; dy++) {
        int nx = s.x + dx, ny = s.y + dy;
        if (nx < 1 || ny < 1 || nx > n || ny > m) continue;
        if (visited[nx][ny] || dx == 0 && dy == 0) continue;
        pq.push(State{nx, ny, s.dist + 1});
        visited[nx][ny] = true;
      }
  }
}

