using namespace std;

#define MAXN 22
#define MAXM 110
#define INF 1e9

double p[MAXN];
bool visited[MAXN][MAXN];
int n, m, startx, starty, adj[MAXM], dist[MAXN];
vector<int> adjList[MAXN];

void bfs(int src, int des){
    for(int i=0; i<n; i++)
        dist[i] = -1;
    queue<int> q;
    q.push(src);
    while(!q.empty()){
        int curr = q.front();
        q.pop();
        if(curr == des){
            dist[curr] = 0;
            return;
        }
        for(int i=0; i<adjList[curr].size(); i++){
            int nxt = adjList[curr][i];
            if(dist[nxt] == -1){
                q.push(nxt);
                dist[nxt] = dist[curr] + 1;
            }
        }
    }
}

double dp(int curr, int des, int dist){
    if(dist == -1 || dist > 100){
        return 0.0;
    }
    else if(curr == des){
        return 1.0;
    }
    else if(dist >= 0 && visited[curr][des]){
        return INF;
    }

    double ans;
    if(p[curr] >= 0.5){
        ans = dp(curr, des, dist-1) + dp(curr, des, dist+1);
        if(dist <= 100){
            visited[curr][des] = true;
        }
    }
    else{
        ans = 1.0 - p[curr] * dp(curr, des, dist) - (1.0 - p[curr]) * dp(curr, des, dist);
        if(dist <= 100){
            visited[curr][des] = true;
        }
    }
    return ans;
}

