    cin >> n >> m >> startx >> starty;
    for(int i=0; i<m; i++){
        cin >> adj[i] >> adj[i+1];
        adj[i]--; adj[i+1]--;
        adjList[adj[i]].push_back(adj[i+1]);
        adjList[adj[i+1]].push_back(adj[i]);
    }
    for(int i=0; i<n; i++){
        cin >> p[i];
    }

    bfs(startx, starty);
    vector<double> res;
    for(int i=0; i<n; i++){
        res.push_back(dp(i, i, dist[i]));
    }
    for(int i=0; i<n; i++){
        cout << fixed << setprecision(12) << res[i] << " ";
    }

    return 0;
}

