const int MAXN = 1 << 7;

bool visit[MAXN];
int n;

void solve(int cur, int pos, int visited, double &prob)
{
    if(visit[pos])
    {
        if(!visited)
            prob = 1.0;
        else
            prob = 1.0 / pow(2, visited - 1);
        return;
    }

    visit[pos] = true;
    if(visited < n)
    {
        int nxt = pos ^ cur;
        if(cur < pos)
            solve(cur, nxt, visited + 1, prob);
        else
            solve(cur, nxt, visited + 1, prob);
    }
}

