void calcP(int current, int w, int b) {
    if (b == 0) { pWinW += pow(w/(w+b), current); return; }
    pWinW += pow(w/(w+b), current) * (b/(w+b)) * 0.5;
    calcP(current + 1, w - ((w/(w+b)) * w), b - ((w/(w+b)) * w) - 1);
}

