long long n;
int k, a[100];
long long ans;

bool ispri(long long n) {
    if (n == 1) return false;
    for (int i = 2; i * i <= n; i++) {
        if (n % i == 0) return false;
    }
    return true;
}

void solve(int pos, long long prime) {
    if (pos == k) {
        if (ispri(n / prime)) {
            ans++;
        }
    }
    else {
        solve(pos + 1, prime);
        solve(pos + 1, prime * (long long)a[pos]);
    }
}

