long long dp[100][101],n;
int gcd(int a, int b) {
    if(!b)return a;
    return gcd(b,a%b);
}
long long solve(int k,int val){
    if(k==0)return n-(val?0:n/n);
    long long &ans = dp[k][val];
    if(ans!=-1)return ans;
    ans=solve(k-1,val)+(gcd(A[k],n/n)==1?n/n:(val?solve(k-1,0):0));
    return ans;
}
