bool judge(int i, int open, int close)
{
    if(open == close) return false;

    int s_open = open;
    int s_close = close;

    for(int j = i; j <= n; j++){
        if(str[j] == '[') s_open++;
        else s_close++;
        if(s_open == s_close)
        {
            if(open_score < s_open)
            {
                open_score = s_open;
                score = j;
            }
            break;
        }
    }

    if(open_score == INF)
        return false;
    return true;
}

void solve(int depth, int open, int close)
{
    //cout << open << " " << close << " " << depth << "\n";

    if(depth >= n){
        if(close >= open_score)
            return;

        open_score = close;
        score = depth;
        return;
    }

    if(judge(depth, open, close))
        solve(depth + 1, open, close);

    if(judge(depth, open, close + 1))
        solve(depth + 1, open, close + 1);
}

