int main(int argc, char const* argv[])
{
    int n, m;
    cin >> n >> m;
    vector< vector<int> > g(m, vector<int>(0));

    for(int i = 0; i!= m; ++i) {
        int k;
        cin >> k;
        for(int j = 0; j!= k; ++j) {
            int x;
            cin >> x;
            g[i].push_back(x);
        }
    }

    vector< vector<double> > memo(n + 1, vector<double>(n + 1, -1.0));

    sort(g.begin(), g.end(), [](vector<int> &a, vector<int> &b) {
        return a.size() > b.size();
    });

    double rec(int n, int k) {
        if(n == 0 || k == 0) return (k == 0? 1.0 : 0.0);
        if(memo[n][k] >= 0.0) return memo[n][k];
        double ans = 0.0;
        for(int i = 0; i!= k; ++i) {
            int a = n - (k - i);
            int b = k - (i + 1);
            if(a < 0) a = 0;
            if(b < 0) b = 0;
            ans += rec(a, b) / k;
        }
        memo[n][k] = ans;
        return ans;
    }

    vector<double> dp(n + 1, 0.0);
    for(int i = 0; i!= m; ++i) {
        for(int j = 0; j!= g[i].size(); ++j) {
            for(int k = 0; k <= n; ++k) {
                dp[k] += rec(n, k) * memo[k][j + 1];
            }
        }
    }

    double ans = 0.0;
    for(int i = 0; i!= n + 1; ++i) {
        ans += dp[i] / g[0].size();
    }

    printf("%.10f\n", ans);

    return EXIT_SUCCESS;
}

