int n, dp[2*MAXN][2*MAXN][30], f[2*MAXN][2*MAXN];

int solve(int i, int j, int num)
{
    if(i == j || i == n || j == n)
        return 0;
    if(dp[i][j][num]!= -1) return dp[i][j][num];
    int res = 0;
    int curr = s[i] - '0';
    if(curr >= num)
    {
        res = max(res, solve(i + 1, j, curr) + num);
        res = max(res, solve(i, j + 1, curr) + num);
        res = max(res, solve(i + 1, j + 1, curr) + num);
    }
    res = max(res, solve(i + 1, j, num) + num);
    res = max(res, solve(i, j + 1, num) + num);

    return dp[i][j][num] = res;
}

int f(int i, int j)
{
    if(i == n || j == n) return 0;
    int curr = s[i] - '0';
    if(f[i][j]!= -1) return f[i][j];
    if(curr >= 0 && curr <= j + 1)
    {
        int res = f(i + 1, j) + curr;
        res = max(res, f(i + 1, j + 1) + curr);
        res = max(res, f(i, j + 1) + curr);
        return f[i][j] = res;
    }
    return f[i][j] = f(i + 1, j);
}

void solve_it(int i, int j, string s)
{
    if(i == n || j == n) return;
    if(i!= j)
    {
        if(s[i]!= '0')
        {
            int curr = s[i] - '0';
            if(curr >= j)
            {
                ans[i] = 'M';
                ans[j] = 'H';
                solve_it(i + 1, j + 1, s.substr(i + 1, 2 * n - i - 1 - j - 1));
            }
            else
            {
                ans[i] = 'H';
                ans[j] = 'M';
                solve_it(i + 1, j + 1, s.substr(i + 1, 2 * n - i - 1 - j - 1));
            }
        }
        else solve_it(i + 1, j, s);
    }
    else
    {
        if(f(i + 1, j) > f(i, j + 1))
        {
            ans[i] = 'H';
            ans[j] = 'M';
        }
        else
        {
            ans[i] = 'M';
            ans[j] = 'H';
        }
        solve_it(i + 1, j + 1, s.substr(i + 1, 2 * n - i - 1 - j - 1));
    }
}

