struct TT
{
    double x;
    double y;
    double z;
};

bool solve(TT* points, double vp, double vs, double* p)
{
    for (int i = 0; i < points[0].x; i++)
    {
        if (p[0] == points[i].x && p[1] == points[i].y && p[2] == points[i].z)
            return true;

        double dist = sqrt( (p[0] - points[i].x) * (p[0] - points[i].x) + (p[1] - points[i].y) * (p[1] - points[i].y) + (p[2] - points[i].z) * (p[2] - points[i].z) );
        double dist2 = dist * vs / vp;

        if (dist2 < dist)
        {
            double x1 = points[i].x + (p[0] - points[i].x) * vs / vp;
            double y1 = points[i].y + (p[1] - points[i].y) * vs / vp;
            double z1 = points[i].z + (p[2] - points[i].z) * vs / vp;

            p[0] = x1;
            p[1] = y1;
            p[2] = z1;

            return true;
        }
    }

    return false;
}

